import React from 'react'


function Header() {
    return (
        <>
            <nav className="navbar navbar-dark bg-dark w-100">
                <div className="container-fluid">
               
                    <a className="navbar-brand ml-5" href='/'>SKeep</a>
                </div>
            </nav>
        </>
    )
}

export default Header
